import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const MainPage = () => {
  const navigate = useNavigate();

  const handleCreateStack = () => {
    // Perform logic to create stack
    // After creating the stack, navigate to the stack detail page
    navigate('/stack-detail/:id'); // Replace :id with the ID of the newly created stack
  };

  return (
    <div style={styles.page}>
      <h1>Welcome to the Main Page</h1>
      <p>This is the main page of your application.</p>
      <button onClick={handleCreateStack} style={styles.button}>Create New Stack</button>
      <Link to="/stacks" style={styles.link}>Show Previous Stacks</Link>
    </div>
  );
};

const styles = {
  page: {
    padding: '20px'
  },
  button: {
    padding: '10px 20px',
    fontSize: '1.2em',
    cursor: 'pointer',
    marginRight: '10px'
  },
  link: {
    textDecoration: 'none',
    color: '#007bff',
    fontSize: '1.2em'
  }
};

export default MainPage;
